INSERT INTO `board` VALUES (1,'1','admin','디저트 커뮤니티 DessertHub가 오픈했습니다!','디저트와 함께하는 따뜻한 커뮤니티, Dessert Hub입니다. 다양한 디저트와 정보를 공유해요!','','2025-01-22 11:53:27',2,1,76,'notice'),(2,'1','admin','사진 업로드 기능이 활성화 되었습니다.','이제 글에 사진도 같이 넣을 수 있습니다.','data:image/jpeg;base64,','2025-01-22 11:58:04',1,2,32,'notice'),(3,'3','랄프왕주먹','요즘 수건 케이크라고 유행하는거 아시나요!???','cu에서 새로 나온 수건 케이크 있는데 너무 맛나보여요 !!! 약간 파르페를 수건처럼 만든 것 같아요 !! ㅎㅎㅎ 앞으로  cu가면 꼭 사야겠어요 ㅋㅋㅋ 인기 많아서 품절 될까봐 걱정 ㅠㅠ ','data:image/jpeg;base64,','2025-01-22 12:12:12',1,0,14,'free'),(4,'3','랄프왕주먹','부드럽고 상큼한 스트로베리 케이크 (⁎⁍̴̛͂▿⁍̴̛͂⁎)*✲ﾟ*｡⋆♡ོ','제철 과일 ~ 너무 맛난다 ㅎㅎ 여러분 겨울에는 꼭 딸기 드세요 ~ >< 부드럽고 상큼한게 너무 좋아요 !!! ','data:image/png;base64,','2025-01-23 11:03:06',0,0,7,'free'),(5,'3','랄프왕주먹','크리마스에 가족과 함께 즐기는 쿠키 ദ്ദി(☆⸝⸝ʚ̴̶̷̆ ᴗ ʚ̴̶̷̆⸝⸝)','크리스마스때 가족들과 함께 맛나게 먹은 쿠키 ! 제가 직접 만든 수제 쿠키입니다 ! ㅎㅎ 추천곡은 뉴진스의 쿠키 입니다 헤헷 ^^ \r\n여러분은 즐거운 크리스마스 보내셨을까요? 앞으로 수제 쿠키 만들 일 많을 것 같습니다 !!! 너무 즐거웠던 경험 >ㅡ< ','data:image/jpeg;base64,','2025-01-23 11:04:29',0,0,6,'free');
